import "./styles/App.css";
import React, {useState} from "react";
import MySelect from "./components/UI/select/MySelect";

// import {useState} from "react";


function App() {

    const [selectionService, setSelectionService] = useState('Послуга');

    return (
        <div className="App">
            <main className="main_new">
                <form className="section_new makeOrder">
                    <div className="makeOrder_item inputs">
                        <h3 className="medium_title">Замовити переклад або редагування</h3>
                        <fieldset className="selector false service" tabIndex="0">
                            <div>
                                <MySelect
                                    value={selectionService}
                                    defaultValue="Послуга"
                                    options={[
                                        {value: 'translate', name: 'Переклад'},
                                        {value: 'edit', name: 'Редагування'},
                                    ]}
                                />
                            </div>
                        </fieldset>
                    </div>
                </form>
            </main>
        </div>
    )
}

export default App;
